int main(void){

	int hour=0,minute=0;
  PLL_Init(Bus80MHz); 
  PortF_Init();
	Timer0A_Init100HzInt();
  ST7735_InitR(INITR_REDTAB);
	  EnableInterrupts();
	
//	while(1)
//	ST7735_FillScreen(0);
	int xcen=63,ycen=73;//40 is the length of the minute hand. 30 is the length of the hour hand
	
	
  while(1){
    ST7735_FillScreen(ST7735_BLACK); 
		

		//ST7735_DrawBitmap(0,137,clock,127,127);
		
		
		
		//centre has to be x=64 y=69
		ST7735_Line(xcen,ycen,63,33,ST7735_BLUE);//is actually red minute
		ST7735_Line(xcen,ycen,33,73,ST7735_RED);//is actually blue hour
		ST7735_SetTextColor(ST7735_BLUE);
		ST7735_OutString("Time Hour:");
		ST7735_OutUDec(hour);
		ST7735_OutString(" Minute:");
		ST7735_OutUDec(minute);
		
		Pause(); 
  } 
} 

// PF4 is input
// Make PF2 an output, enable digital I/O, ensure alt. functions off
void PortF_Init(void){ 
  SYSCTL_RCGCGPIO_R |= 0x20;        // 1) activate clock for Port F
  while((SYSCTL_PRGPIO_R&0x20)==0){}; // allow time for clock to start
                                    // 2) no need to unlock PF2, PF4
  GPIO_PORTF_PCTL_R &= ~0x000F0F00; // 3) regular GPIO
  GPIO_PORTF_AMSEL_R &= ~0x14;      // 4) disable analog function on PF2, PF4
  GPIO_PORTF_PUR_R |= 0x10;         // 5) pullup for PF4
  GPIO_PORTF_DIR_R |= 0x04;         // 5) set direction to output
  GPIO_PORTF_AFSEL_R &= ~0x14;      // 6) regular port function
  GPIO_PORTF_DEN_R |= 0x14;         // 7) enable digital port
}


